  render() {
    return (
      <div>
        <BrowserRouter>

       <Route path="/" exact component={RestaurantList}></Route>
       <Route path="/editRestaurant/:id" component={EditRestaurant}></Route>

   </BrowserRouter>


      </div>
    )
  }
